import React from 'react';
import { Link } from 'react-router-dom';

const CTASection = () => {
  return (
    <section className="cta">
      <h2>Want to RSVP?</h2>
      <Link to="/rsvp" className="cta-button">
        Let's Reunite
      </Link>
    </section>
  );
};

export default CTASection;
